import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import './Pages.css';

const OrderHistory = () => {
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [debugInfo, setDebugInfo] = useState({});

  const fetchOrders = async () => {
    try {
      setLoading(true);
      setError(null);

      const token = localStorage.getItem('weKnowToken');
      const user = localStorage.getItem('weKnowUser');

      console.log('=== DEBUG INFO ===');
      console.log('Token found:', !!token);
      console.log('Token value:', token);
      console.log('User found:', !!user);
      console.log('User value:', user);

      setDebugInfo({
        tokenFound: !!token,
        tokenValue: token,
        userFound: !!user,
        userValue: user
      });

      if (!token) {
        setError('Please login to view your orders');
        setLoading(false);
        return;
      }

      console.log('Making API call to: http://localhost:8000/user/orders');
      const response = await axios.get('http://localhost:8000/user/orders', {
        headers: {
          'Authorization': `Bearer ${token}`
        }
      });

      console.log('API Response Status:', response.status);
      console.log('API Response Data:', response.data);

      if (response.data.success) {
        console.log('Orders fetched successfully:', response.data.orders);
        setOrders(response.data.orders || []);
      } else {
        console.error('Failed to load orders:', response.data.error);
        setError(response.data.error || 'Failed to load orders');
      }
    } catch (err) {
      console.error('=== ERROR DETAILS ===');
      console.error('Error type:', err.constructor.name);
      console.error('Error message:', err.message);
      console.error('Error response status:', err.response?.status);
      console.error('Error response data:', err.response?.data);
      console.error('Error response headers:', err.response?.headers);

      if (err.response?.status === 401) {
        setError('Please login to view your orders');
      } else {
        setError(`Failed to load orders: ${err.message}`);
      }
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchOrders();
  }, []);

  const handleRefresh = () => {
    fetchOrders();
  };

  const handleTestOrder = async () => {
    try {
      const token = localStorage.getItem('weKnowToken');
      console.log('Testing order placement with token:', !!token);

      const response = await axios.post('http://localhost:8000/user/orders', {
        dish_name: 'Test Order from Frontend',
        ingredients: [{'ingredient': 'Test Ingredient', 'quantity': 1, 'unit': 'piece'}],
        servings: 1
      }, {
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        }
      });

      console.log('Test order response:', response.data);
      alert('Test order placed successfully! Check console for details.');

      // Refresh orders after placing test order
      setTimeout(() => {
        fetchOrders();
      }, 1000);

    } catch (error) {
      console.error('Test order failed:', error);
      alert(`Test order failed: ${error.message}`);
    }
  };

  return (
    <div className="page-container">
      <div className="page-header">
        <Link to="/" className="back-button">
          ‚Üê Back to Home
        </Link>
        <h1>Order History (Debug Mode)</h1>
        <div>
          <button onClick={handleRefresh} className="refresh-button">
            üîÑ Refresh
          </button>
          <button onClick={handleTestOrder} className="test-button" style={{marginLeft: '10px', background: '#28a745'}}>
            üß™ Test Order
          </button>
        </div>
      </div>

      {/* Debug Information */}
      <div style={{background: '#f8f9fa', padding: '15px', marginBottom: '20px', borderRadius: '8px', border: '1px solid #dee2e6'}}>
        <h4>üîç Debug Information:</h4>
        <p><strong>Token Found:</strong> {debugInfo.tokenFound ? '‚úÖ Yes' : '‚ùå No'}</p>
        <p><strong>User Found:</strong> {debugInfo.userFound ? '‚úÖ Yes' : '‚ùå No'}</p>
        <p><strong>Token Value:</strong> {debugInfo.tokenValue ? debugInfo.tokenValue.substring(0, 50) + '...' : 'None'}</p>
        <p><strong>User Value:</strong> {debugInfo.userValue || 'None'}</p>
      </div>

      <div className="page-content">
        {loading ? (
          <div className="loading-state">
            <div className="loading-spinner"></div>
            <p>Loading your orders...</p>
          </div>
        ) : error ? (
          <div className="error-state">
            <div className="error-icon">‚ö†Ô∏è</div>
            <h3>Error Loading Orders</h3>
            <p>{error}</p>
            <button onClick={handleRefresh} className="retry-button">
              Try Again
            </button>
          </div>
        ) : orders.length > 0 ? (
          <div className="orders-list">
            <h3>‚úÖ Found {orders.length} orders:</h3>
            {orders.map((order) => (
              <div key={order.id} className="order-card">
                <div className="order-header">
                  <h3>{order.dish_name}</h3>
                  <span className={`status-badge ${(order.status || 'pending').toLowerCase()}`}>
                    {order.status || 'Pending'}
                  </span>
                </div>

                <div className="order-details">
                  <p><strong>Order ID:</strong> {order.id || 'N/A'}</p>
                  <p><strong>Date:</strong> {order.timestamp ? new Date(order.timestamp).toLocaleDateString() : 'N/A'}</p>
                  <p><strong>Servings:</strong> {order.servings || 2}</p>
                </div>

                <div className="ingredients-section">
                  <h4>Ingredients Delivered:</h4>
                  <div className="ingredients-tags">
                    {order.ingredients && order.ingredients.length > 0 ? (
                      order.ingredients.map((ingredient, index) => {
                        const quantity = ingredient.quantity;
                        const unit = ingredient.unit || '';
                        const name = ingredient.ingredient || ingredient.name || 'Unknown ingredient';

                        return (
                          <span key={index} className="ingredient-tag">
                            {quantity !== null ? `${quantity} ${unit} ` : ''}{name}
                          </span>
                        );
                      })
                    ) : (
                      <span className="ingredient-tag">No ingredients available</span>
                    )}
                  </div>
                </div>
              </div>
            ))}
          </div>
        ) : (
          <div className="empty-state">
            <div className="empty-icon">üìã</div>
            <h3>No Orders Found</h3>
            <p>You haven't placed any orders yet or there's an issue with the API call.</p>
            <p>Check the browser console (F12) for detailed debug information.</p>
            <Link to="/" className="cta-button">
              Place Your First Order
            </Link>
          </div>
        )}
      </div>
    </div>
  );
};

export default OrderHistory;
